import React from "react";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import Slider from "react-slick";

const ImageSlider = () => {
  let settings = {
    dots: false,
    infinite: true,
    speed: 500,
    slideToShow: 1,
    slideToScroll: 1,
    autoplay: true,
  };
  return (
    <nav className="text-white p- dark:bg-gray-900">
      <div className="">
        <div className="">
          <Slider {...settings}>
            <div>
              <h1>test 1</h1>
            </div>
            <div>
              <h1>test 2</h1>
            </div>
            <div>
              <h1>test 3</h1>
            </div>
          </Slider>
        </div>
      </div>
    </nav>
  );
};

export default ImageSlider;
